import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import RequestRide from './pages/RequestRide.tsx';
import RideOptions from './pages/RideOptions.tsx';
import TravelHistoryPage from './pages/TravelHistoryPage.tsx';

const App: React.FC = () => {
    return (
      <Router>
        <Routes>
          {/* Rota padrão para a página inicial */}
          <Route path="/" element={<RequestRide />} />  {/* Ou qualquer outra página que deseja na página inicial */}
  
          {/* Rota para a página de opções de viagem */}
          <Route path="/opcoes" element={<RideOptions />} />
  
          {/* Rota para a página de histórico de viagens */}
          <Route path="/historico" element={<TravelHistoryPage />} />
        </Routes>
      </Router>
    );
  };
export default App;
